import style from './Form.module.css'

export const Form = () => {
  return (
    <div className={style.containerForm}>
      <h1>Create Video Game</h1>
      <form className={style.containerInputsForm}>
      <label> Name <input value="Name" type="text" name="name" ></input> </label>
      <label> Summary <input value={form.summary} type="text" name="summary" ></input> </label>
      </form>
    </div>
  );
};
